import axios from 'axios';

export async function fetchExchangeRate() {
  const url = `https://www.koreaexim.go.kr/site/program/financial/exchangeJSON?authkey=3wNf5tfXGjytedr8fF3AUEljbd30YBED&data=AP01`;
  try {
    const { data } = await axios.get('/api'+url);
    console.log(data);
  } catch (error) {
    console.error('Error fetching exchange rate:', error);
  }
}
